style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("edumetrics.org") {
  img[src *="/icons/unknown.gif"] + a:before, img[src="/icons/compressed.gif"] + a:before{
    /*http://www.moktoipas.com/icones/unknown.png*/
    content: url("data:image/png;base64,")!important;
  }

  img[src *= "/icons/folder.gif"] + a:before{
    /*http://www.moktoipas.com/icones/menu.png*/
    content: url("data:image/png;base64,")!important;
  }

  img[src *= "/icons/folder.gif"], img[src *="/icons/unknown.gif"], img[src="/icons/compressed.gif"]{
    display: none!important
  }
}
